import React from 'react'; 
import './Moves.css';

const Moves = ({moveHistory}) => {

	return (
		<div id="moves"> 
			<div id="top_row"> Moves </div>
			<div id="moves_table">
				<div className="move_number">1</div> <div className="move_white"> e4 </div> <div className="move_black"> e5 </div>
				<div className="move_number">2</div> <div className="move_white"> e4 </div> <div className="move_black"> e5 </div>
				<div className="move_number">3</div> <div className="move_white"> e4 </div> <div className="move_black"> e5 </div>
			</div>
		</div>
	);
}

export default Moves;
